class Calculate
  def call(player, strategy = "current_position_rating")
    send("filter_by_#{strategy}", player)
  end


  private

  def filter_by_current_position_rating(player, response = [])
    data[player.position.downcase].each do |archetype, ratings|
      response << [
        archetype,
        ratings.inject(0.to_d) do |total, (rating, value)|
          total += (player.attributes[rating] * (value.to_d / 100))
        end.floor.to_i
      ]
    end

    top_ovr = response.sort{|a,b| b[1]<=>a[1]}.first[1]

    response.keep_if{|i| i[1] == top_ovr}
  end

  def filter_by_specific_position_rating(player, response = [])
    data["fb"].each do |archetype, ratings|
      response << [
        archetype,
        ratings.inject(0.to_d) do |total, (rating, value)|
          total += (player.attributes[rating] * (value.to_d / 100))
        end.floor.to_i
      ]
    end

    response.keep_if{|i| i[1] >= 76}
  end

  def filter_by_all_positions(player, response = [])
    data.each do |position, obj|
      resp = []

      obj.each do |archetype, ratings|
        resp << [
          [position, archetype].join("_"),
          ratings.inject(0.to_d) do |total, (rating, value)|
            total += (player.attributes[rating] * (value.to_d / 100))
          end.floor.to_i
        ]
      end

      response << resp.sort{|a,b| b[1]<=>a[1]}.first
    end

    response.sort{|a,b| b[1]<=>a[1]}[0...5]
  end

